	protected void agentSpecificSetup() throws AgentInitializationException{
		
		super.agentSpecificSetup();
		dcM.init(this);
		
		this.homeI = Supervisor.migI.get(Supervisor.contHomeMap.get("contHome"));
		this.homeJ = Supervisor.migJ.get(Supervisor.contHomeMap.get("contHome"));
		Supervisor.contHomeMap.computeIfPresent("contHome", (key,val) -> val + 1);
		this.selfI = this.homeI;
		this.selfJ = this.homeJ;
		if (this.homeJ > Supervisor.N/2) {
			Migrant.notMigrated.put(this.getAID(),this.selfJ);
		}
		Clock.migrantAID.add(this.getAID());
		ArrayList<Integer> firm_pos = searchAround(selfI,selfJ,2);
		alpha = Supervisor.firm.get(firm_pos.get(0)+","+firm_pos.get(1));
		
		Supervisor.linkComm.put(this.selfI+","+this.selfJ,this.getAID());
		
		Map params = new HashMap();
		
		params.put("homeI", this.homeI);
		params.put("homeJ", this.homeJ);
		params.put("selfI", this.selfI);
		params.put("selfJ", this.selfJ);
		params.put("alpha", this.alpha);
		
		WorkflowDescriptor wd = new WorkflowDescriptor("migrant.MigrantWorkflow",params);
		try {
			dcM.launchWorkflow(getAID(),wd,null,null);
		} catch (WorkflowException e) {
			e.printStackTrace();
		}
	}
	
	//guarda tutte le patch nel quadrato di lato D il cui centro  (x, y) in cerca di celle di tipo target, fino a trovarne una
    public ArrayList<Integer> searchAround (int x, int y, int target){//x e y sono la posizione dell'agente a cui fa riferimento
        boolean value = false;
        ArrayList<Integer> pos = new ArrayList<Integer>();
        int D = 0;
        int i = x - D;
        int j = y - D;
        while (value == false){
	        if (y < Supervisor.N/2) {
	        	while(j < y + D && value == false){
	        		try {
	        			if (Supervisor.map[i][j] == target && j < Supervisor.N/2) {
	        				pos.add(i);
	        				pos.add(j);
	        				value = true;
	        			}
	        			j++;
	        		} catch(ArrayIndexOutOfBoundsException e1) {
	        			j++;
	        		}
	        	}
	        	while(i < x + D && value == false){
	        		try {
	        			if (Supervisor.map[i][j] == target && j < Supervisor.N/2) {
	        				pos.add(i);
	        				pos.add(j);
	        				value = true;
	        			}
	        			i++;
	        		} catch(ArrayIndexOutOfBoundsException e2) {
	        			i++;
	        		}
	        	}
	        	while(j > y - D && value == false){
	        		try {
	        			if (Supervisor.map[i][j] == target && j < Supervisor.N/2) {
	        				pos.add(i);
	        				pos.add(j);
	        				value = true;
	        			}
	        			j--;
	        		} catch(ArrayIndexOutOfBoundsException e3) {
	        			j--;
	        		}
	        	}
	        	while(i > x - D && value == false){
	        		try {
	        			if (Supervisor.map[i][j] == target && j < Supervisor.N/2) {
	        				pos.add(i);
	        				pos.add(j);
	        				value = true;
	        			}
	        			i--;
	        		} catch(ArrayIndexOutOfBoundsException e4) {
	        			i--;
	        		}
	        	}
	        	D++;
	        	i = x - D;
	        	j = y - D;
	        }
	    if (y > Supervisor.N/2) {
        	while(j < y + D && value == false){
        		try {
        			if (Supervisor.map[i][j] == target && j > Supervisor.N/2) {
        				pos.add(i);
        				pos.add(j);
        				value = true;
        			}
        			j++;
        		} catch(ArrayIndexOutOfBoundsException e1) {
        			j++;
        		}
        	}
        	while(i < x + D && value == false){
        		try {
        			if (Supervisor.map[i][j] == target && j > Supervisor.N/2) {
        				pos.add(i);
        				pos.add(j);
        				value = true;
        			}
        			i++;
        		} catch(ArrayIndexOutOfBoundsException e2) {
        			i++;
        		}
        	}
        	while(j > y - D && value == false){
        		try {
        			if (Supervisor.map[i][j] == target && j > Supervisor.N/2) {
        				pos.add(i);
        				pos.add(j);
        				value = true;
        			}
        			j--;
        		} catch(ArrayIndexOutOfBoundsException e3) {
        			j--;
        		}
        	}
        	while(i > x - D && value == false){
        		try {
        			if (Supervisor.map[i][j] == target && j > Supervisor.N/2) {
        				pos.add(i);
        				pos.add(j);
        				value = true;
        			}
        			i--;
        		} catch(ArrayIndexOutOfBoundsException e4) {
        			i--;
        		}
        	}
        	D++;
        	i = x - D;
        	j = y - D;
        }
        }
        return pos;
    }
